const { Deque } = require('double-ended-queue');

function f_gold(board) {
    function get(x) {
        let i = Math.floor((x - 1) / n), j = (x - 1) % n;
        if (i & 1) {
            j = n - 1 - j;
        }
        return [n - 1 - i, j];
    }
    const n = board.length;
    const q = new Deque([1]);
    const vis = new Set([1]);
    let ans = 0;
    while (q.length > 0) {
        for (let i = q.length; i > 0; i--) {
            const curr = q.shift();
            if (curr === n * n) {
                return ans;
            }
            for (let next = curr + 1; next <= Math.min(curr + 6, n * n); next++) {
                const [i, j] = get(next);
                if (board[i][j] !== -1) {
                    next = board[i][j];
                }
                if (!vis.has(next)) {
                    q.push(next);
                    vis.add(next);
                }
            }
        }
        ans++;
    }
    return -1;
}
